import "./App.css";
import axios from "axios";
import React from "react";

class App extends React.Component {
  statte = { datails: [] };

  componentDidMount() {
    let data;
    axios
      .get("http://localhost:8000")
      .then((res) => {
        data = res.data;
        this.setState({ datailsa: data });
      })
      .catch((err) => {
        console.log(err);
      });
  }
  render() {
    return (
      <div className="App">
        <header>Данные из Джанго</header>
        <hr></hr>
        {this.state.datails.map((output, id) => (
          <div>
            <h2>{output.title}</h2>
            <p>{output.channel}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default App;
